type StaticResult struct {
	Uid       string
	Nick      string
	PickTime  time.Time
	ArticleId string
	PickType  int
	FirstPick bool
	Pass      bool //是否过审
}

func A() {
	resultMap := make(map[string][]StaticResult)

	err := json.Unmarshal([]byte(jsonD), &resultMap)

	if err != nil {
		fmt.Println(err)
	}

	f := excelize.NewFile()

	for uid, v := range resultMap {
		f.NewSheet(uid)

		//设置第一行标题
		SetTitleForSheet(f, uid)

		var r = 2
		for _, static := range v {

			m := map[string]string{
				fmt.Sprintf("A%d", r): static.Uid,
				fmt.Sprintf("B%d", r): static.Nick,
				fmt.Sprintf("C%d", r): static.ArticleId,
				fmt.Sprintf("D%d", r): fmt.Sprintf("%d", static.PickType),
				fmt.Sprintf("E%d", r): bool2Chinese(static.FirstPick),
				fmt.Sprintf("F%d", r): bool2Chinese(static.Pass),
				fmt.Sprintf("G%d", r): static.PickTime.Format("2006-01-02 15:04:05"),
			}

			for point, value := range m {
				f.SetCellValue(uid, point, value)
			}

			r++
		}
	}
	if err := f.SaveAs("Book1.xlsx"); err != nil {
		fmt.Println(err)
	}

}

func SetTitleForSheet(f *excelize.File, sheet string) {
	f.SetCellValue(sheet, "A1", "用户id")
	f.SetCellValue(sheet, "B1", "用户昵称")
	f.SetCellValue(sheet, "C1", "文章id")
	f.SetCellValue(sheet, "D1", "pick类型")
	f.SetCellValue(sheet, "E1", "是否第一个pick")
	f.SetCellValue(sheet, "F1", "通航审核状态")
	f.SetCellValue(sheet, "G1", "pick时间")
}

func bool2Chinese(b bool) string {
	if b {
		return "是"
	}
	return "否"

}
